import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './home/home.component';
import { LiveComponent } from './live/live.component';
import { PlayersComponent } from './players/players.component';
import { RecentComponent } from './recent/recent.component';
import { WelcomeComponent } from './welcome/welcome.component';

const routes: Routes = [
  {path : 'app-welcome', component: WelcomeComponent},
  {path : '', component: HomeComponent},
  {path : 'app-live', component: LiveComponent},
  {path : 'app-recent', component: RecentComponent},
  {path : 'app-players', component: PlayersComponent},
  {path : 'app-recnt/:id', component : PlayersComponent}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
export const routingComponents = [WelcomeComponent,
                                  HomeComponent,
                                  LiveComponent,
                                  RecentComponent,
                                  PlayersComponent]
